zc='DefaultSelectionEventManager$SelectAction',kzc='DefaultSelectionEventManager$SelectAction;',TAc='DefaultUnitConverter',UAc='DelayedRunnable',VAc='DelayedRunnable$1',Mec='Deutsch',dxc='DialogBox',jxc='DialogBox$1',hxc='DialogBox$CaptionImpl',ixc='DialogBox$MouseHandler',sqc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",XAc='Dimension',smc='Dimension [height=',kxc='DirectionalTextHelper',nxc='DockLayoutPanel',oxc='DockLayoutPanel$Direction',pxc='DockLayoutPanel$Direction;',sxc='DockLayoutPanel$DockAnimateCommand',qxc='DockLayoutPanel$LayoutData',wtc='DomEvent',Btc='DomEvent$Type',Fzc='Double',tjc='EAST',rdc='EEE, d MMM yyyy HH:mm:ss Z',opc='EEE. dd MMM. yyyy HH:mm:ss',rec='EEEE MMMM d',Sec='EEEE, MMMM d',Oec='EEEE, MMMM d, y',nec='EEEE, y MMMM dd',Yac='EM',$gc='EMPTY',dhc='ENABLED',kfc='END',$ac='EX',Tvc='ElementMapperImpl',Uvc='ElementMapperImpl$FreeNode',Nec='English',Jsc='Enum',Eec='Etc/GMT',Gec='Etc/GMT+',Fec='Etc/GMT-',nbc='Event type',Lyc='Event$NativePreviewEvent',Otc='EventBus',$rc='EventObject',dsc='Exception',Zhc='Expecting version 6 from server, got ',icc='F',xnc='F8834F07517EF3B7D02B9E845E5E1B88',Tac='FIXED',vic='FLOAT',cnc='Fail: ',Ccc='Feb',qcc='February',Tqc='Female',Gzc='Float',txc='FlowPanel',Twc='FocusWidget',ulc='For input string: "',edc='Fri',Zcc='Friday',Bbc='GET',Fpc='GGD55XLBAH',prc='GGD55XLBAJ',Cqc='GGD55XLBBI',Epc='GGD55XLBCH',Eqc='GGD55XLBCI',Bgc='GGD55XLBDB',Dpc='GGD55XLBDH',yrc='GGD55XLBDJ',lqc='GGD55XLBDK',bgc='GGD55XLBEB',Bpc='GGD55XLBEH',Dqc='GGD55XLBEI',qrc='GGD55XLBEJ',Cgc='GGD55XLBFB',Ipc='GGD55XLBFH',_qc='GGD55XLBFI',Rrc='GGD55XLBFK',Yqc='GGD55XLBGI',Prc='GGD55XLBGK',Fgc='GGD55XLBHB',Qpc='GGD55XLBHH',Mqc='GGD55XLBHI',Orc='GGD55XLBHK',Spc='GGD55XLBIH',Lrc='GGD55XLBIK',Rpc='GGD55XLBJH',Noc='GGD55XLBJJ',Qrc='GGD55XLBJK',bqc='GGD55XLBKG',xqc='GGD55XLBKH',
